import React from 'react';
import './App.css';
import {Switch,Route} from 'react-router-dom'
import HomePage from './pages/homepage/homepage.components';

const HatsPage = () => (
 <div>
   <h1> HATS PAGE</h1>
 </div>
);


function App() {

  return (
    <Switch>
    <div>
    <HomePage />
    <Route exact={true} path='/' component='HomePage' />
    <Route  path='/hats' component='HatsPage' />
    </div>
  </Switch> 
  );
}

export default App;
